import React from "react";
import styled from "styled-components";
import MyInnerImgSlider from "../innersmallslider/InnerImgSlider";
export default function Details() {
  return (
    <MainContainer>
      <MyInnerImgSlider/>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  border: 2px solid blue;
  width: 90%;
  position: relative;
  left: 80px;
  top: 40px;
`;
